  jQuery(function() {
    var states;
    $('#commissariat_arrondissement_id').parent().hide();
    states = $('#commissariat_arrondissement_id').html();
    return $('#commissariat_departement_id').change(function() {
      var country, escaped_country, options;
      country = $('#commissariat_region_id :selected').text();
      escaped_country = country.replace(/([ #;&,.+*~\':"!^$[\]()=>|\/@])/g, '\\$1');
      options = $(states).filter("optgroup[label='" + escaped_country + "']").html();
      if (options) {
        $('#commissariat_arrondissement_id').html(options).addClass('form-control');
        return $('#commissariat_arrondissement_id').parent().show();
      } else {
        return $('#commissariat_arrondissement_id').text('Aucune valeur');
      }
    });
  });

